<script>
document.getElementById('btnLogin').addEventListener('click', (e) => {
  var loginContainer = document.getElementById("loginContainer");
    loginContainer.style.display = "none";
  
  var loginText = document.getElementById('email').value.toLowerCase();
   var collapse = null;
  
  if(loginText.includes('erick')){
	collapse = document.getElementById('collapsErick');
   }else if(loginText.includes('gustavo')){
     collapse = document.getElementById('collapsGustavo');
  }else if(loginText.includes('olivia')){
     collapse = document.getElementById('collapsOlivia');
  }else if(loginText.includes('gab')){
     collapse = document.getElementById('collapsGab');
  }else if(loginText.includes('caio')){
     collapse = document.getElementById('collapsCaio');
   }
   new bootstrap.Collapse(collapse).show();

});
</script>
